import puppeteer from "puppeteer";
import path from "path";
import fs from "fs";

export async function kline() {
    const browser = await puppeteer.launch({ headless: "new" });
    const page = await browser.newPage();
    // set win width and height
    await page.setViewport({
        width: 1920,
        height: 1080,
    });
    // open your TradingView chart URL
    //await page.goto('https://www.gate.io/zh/trade/BLADE_USDT');
    await page.goto(
        "https://www.tradingview.com/chart/hIV4GuP8/?symbol=CFXUSDT&interval=1H"
    );
    const imageDir = path.join(process.cwd(), "generatedKLines");
    if (!fs.existsSync(imageDir)) {
        fs.mkdirSync(imageDir, { recursive: true });
    }
    const filePath = path.join(imageDir, `kline-${new Date().getTime()}.png`);
    // set clip ares
    const chartElement = await page.$(".chart-container"); // select DOM
    await chartElement?.screenshot({ path: filePath });

    await browser.close();
    return filePath;
    //return f"data:image/jpeg;base64,";
}
